import React, { Component } from 'react';
import { bindActionCreators } from 'redux'; 
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import Header from './components/Header'
import HeaderSub from './components/HeaderSub'
import Filter from './components/Filter'
import FilterCategory from './components/FilterCategory'
import Footer from './components/Footer'
import ProductCards from './components/ProductCards'

import queryString from 'query-string'

import { 
	getCategoriesInDepartment,
	getProductsInDepartment,
} from './actions/index';



class Departments extends Component {
	constructor(){
		super()

		this.state = {

		}
	}

	render(){

		let user
		let profile
		if(this.props.user){
			user = this.props.user
			console.log(user)

			profile = (
				<div>
				<h4>{user.address_1}</h4>
				<h4>{user.address_2}</h4>
				<h4>{user.city}</h4>
				<h4>{user.credit_card}</h4>
				<h4>{user.customer_id}</h4>
				<h4>{user.day_phone}</h4>
				<h4>{user.email}</h4>
				<h4>{user.mob_phone}</h4>
				<h4>{user.name}</h4>
				<h4>{user.postal_code}</h4>
				<h4>{user.region}</h4>
				<h4>{user.shipping_region_id}</h4>
				</div>

			)
		}

		return(
		    <div>

		    {profile}

		    </div>
		)
	}
}



function mapStateToProps(state){
	return { 	
		user:state.user.user
	};
}

const mapDispatchToProps = (dispatch) => {
	return bindActionCreators({
		getCategoriesInDepartment:getCategoriesInDepartment,
		getProductsInDepartment:getProductsInDepartment,
	}, dispatch);
};

Departments = connect(mapStateToProps, mapDispatchToProps)(Departments);
export default withRouter(Departments);
